function buffer(){setTimeout(showPage,3e3)}function showPage(){document.getElementById("loader").style.display="none",document.getElementById("buffer").style.display="block"}function countdown(e){var t=new Date(e).getTime(),n=setInterval(function(){var e=(new Date).getTime(),o=t-e,a=Math.floor(o/864e5),r=Math.floor(o%864e5/36e5),u=Math.floor(o%36e5/6e4),c=Math.floor(o%6e4/1e3);document.getElementById("counter").innerHTML=a+"d "+r+"h "+u+"m "+c+"s ",o<0&&(clearInterval(n),document.getElementById("counter").innerHTML="EXPIRED")},1e3)}function getSubscribers(e){$.ajax({type:"POST",url:"subs_backend.py",data:{param:e},dataType:"text",success:function(e){document.getElementById("subs").textContent=e.toString(),console.log(e.toString())}})}